-- TASK TWO Part 1 - Create tables

-- First CREATE TABLES
CREATE TABLE department(deptID varchar(3) PRIMARY KEY,deptName varchar(20) UNIQUE NOT NULL,phone varchar(16),opening varchar(5),head varchar(8) NOT NULL,active varchar(3) NOT NULL);CREATE TABLE staff(staffID varchar(8) PRIMARY KEY,fName varchar(15) NOT NULL,lName varchar(20) NOT NULL,streetAddress varchar(50),area varchar(25),county varchar(15),email varchar(30) NOT NULL,phone varchar(16), deptID varchar (3),years int(2) NOT NULL,ptoTaken int(2) NOT NULL,position varchar(25) NOT NULL);CREATE TABLE students(studentID varchar(8) PRIMARY KEY,fName varchar(15) NOT NULL,lName varchar(20) NOT NULL,streetAddress varchar(50),area varchar(25),county varchar(15),email varchar(30) NOT NULL,phone varchar(16),courseCode varchar(6) NOT NULL,yr1Grade int(3),yr2Grade int(3),yr3Grade int(3),yr4Grade int(3),year varchar(10) NOT NULL,lastPayment date NOT NULL,outstandingFees decimal(5,2) NOT NULL);CREATE TABLE courses(courseCode varchar(6) PRIMARY KEY,courseName varchar(35) NOT NULL,qqi int(2) NOT NULL,award varchar(25) NOT NULL,cost decimal(5,2) NOT NULL,semesters int(2) NOT NULL,years int(2) NOT NULL,deptID varchar(3) NOT NULL,delivery varchar(10) NOT NULL,coordinator varchar(8));

-- Table needs some data populated before Foreign keys can be set. Once first batch of data entered, these ALTER TABLES to be run
ALTER TABLE department ADD FOREIGN KEY (head) REFERENCES staff (staffID) ON UPDATE CASCADE ON DELETE RESTRICT;ALTER TABLE staff ADD FOREIGN KEY (deptID) REFERENCES department (deptID) ON UPDATE CASCADE ON DELETE SET NULL;ALTER TABLE students ADD FOREIGN KEY (courseCode) REFERENCES courses (courseCode) ON UPDATE CASCADE ON DELETE RESTRICT;ALTER TABLE courses ADD FOREIGN KEY (deptID) REFERENCES department (deptID) ON UPDATE CASCADE ON DELETE RESTRICT, ADD FOREIGN KEY (coordinator) REFERENCES staff (staffID) ON UPDATE CASCADE ON DELETE SET NULL;



